import React from 'react';
import { Navigate } from 'react-router';

const ProtectedRoutes = () => {
	const navigate = useNavigate();

	useEffect(() => {
		if (localStorage.getItem('token')) {
		} else {
			navigate('/login');
		}
	}, []);

	return <div>ProtectedRoutes</div>;
};

export default ProtectedRoutes;
